import React from 'react';
import { useSelector } from 'react-redux';

function Confirm(props) {
    const sendItem = useSelector(state => state.sendItem)
    return (
        <React.Fragment>
            <div>
                {sendItem.Name}
            </div>
        </React.Fragment>
    );
}

export default Confirm;
